  { title: "Shopping", amount: "6900", date: new Date(2023, 5, 9) }];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem val={expenses[0]} />
      <ExpenseItem val={expenses[0]} />
      <ExpenseItem val={expenses[0]}/>
    </div>
  );
}

